import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import { Card } from 'pages/Card';

const Index = () => (
    // border bottom
    <Container>
    <Row>
      <Col>.col</Col>
      <Col>.col</Col>
      <Col>.col</Col>
    </Row>
    <Row>
        <p> Launched on OrangePick today </p>
    </Row>
    <Card></Card>
    </Container>
    //before container row then the card
  )
export default Index
